                    <h1 className='mt-5'>Invest in everything</h1>
                    <p>Online platform to invest in stocks, derivatives, mutual funds and more.</p>
                    <button className=' p-2  mx-auto mt-3 signup-Btn '> <a href='/signup' className=' text-decoration-none'> Sign up Now</a></button>

                </div>
            </div>
        </>
    );
}

export default Hero;
